const minimumSwaps = (arr) => {
  let count = 0;
  for(let item = 0; item < arr.length -1; item++) {
    // keep the position in array and search for the rigth value in the rest of the array
    // teh rigth value, for the position = array[item], has to be item + 1 - starting with 1
    for (let x = item +1; x < arr.length; x++) {
        // search for the rigth value in the position = item +1 - if starts with 1
        if (item +1 == arr[x]) {
          // if found swap it
          const temp = arr[item]; // position
          arr[item] = arr[x];
          arr[x] = temp;
          count++;
        }
    }
  }
  return count;
}

